import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";



function App(){
    return (
        <div>
            <Header />
            {notes.map(function createNote(ele){
                return (
                    <Note
                        key = {ele.id}
                        title = {ele.title}
                        content = {ele.content}
                    />
                );
            })}
            <Footer />
        </div>
    );
}

export default App;
